import React from "react";
import "./styles/watchlist.css"; // Import CSS file

const Watchlist = () => {
  return (
    <div className="watchlist">
      <div className="card">Watchlist</div>
      <div className="watch-list">
        <ul className="cards">
          <li className="card-items">Stock 1</li>
          <li className="card-items">Stock 2</li>
          <li className="card-items">Stock 3</li>
          {/* Add more stocks as needed */}
        </ul>
      </div>
    </div>
  );
};

export default Watchlist;
